// Helper functions
export const getPlayersByPosition = (position) => players.filter(p => p.position === position);
export const getPlayerById = (id) => players.find(p => p.id === id);
export const searchPlayers = (query) => {
  const lowerQuery = query.toLowerCase();
  const yearMatch = lowerQuery.match(/20\d{2}/);
  const hasPick = lowerQuery.includes('pick');

  return players.filter(p => {
    const lowerName = p.name.toLowerCase();

    // Direct name match (e.g. "2027 pick 1" matches "2027 pick 1.01")
    if (lowerName.includes(lowerQuery)) return true;

    // Team or position match
    if (p.team.toLowerCase().includes(lowerQuery)) return true;
    if (p.position.toLowerCase().includes(lowerQuery)) return true;

    // Pick queries with a year  only match that year's picks
    if (hasPick && yearMatch && p.position === 'PICK') {
      return lowerName.includes(yearMatch[0]);
    }

    // Generic "pick" with no year  match all picks
    if (hasPick && !yearMatch && p.position === 'PICK') return true;

    // Year-only query  match all entries for that year
    if (yearMatch && !hasPick) {
      return lowerName.includes(yearMatch[0]);
    }

    return false;
  });
};

export const getAggregateRanking = (player) => {
  const { DLF, UTH, DynastyNerds, FantasyPros } = player.rankings;
  return Math.round((DLF + UTH + DynastyNerds + FantasyPros) / 4);
};

export const getTeamName = (abbr) => teams[abbr] || abbr;
export const getByeWeek = (team) => byeWeeks[team] || 'N/A';

export const formatSalary = (salary) => {
  if (salary >= 1000000) {
    return `$${(salary / 1000000).toFixed(1)}M`;
  }
  return `$${(salary / 1000).toFixed(0)}K`;
};

export default players;
